import React, { useState } from "react";
import './nav-menu.css';
import { Link } from "react-router-dom";
import navitems from './nav-items'
const Navmenuitems = ()=> {
  const [pos,setPos]=useState(false);
  const  handlehumb=()=>{
    setPos(!pos);

  }
  
  
  return<>
       <div className='navbar'>
      <h1>Trippy</h1> 
      <div className="humb" onClick={handlehumb}>
        <i className={pos?"fa-solid fa-times":"fa-solid fa-bars"}></i>
      </div>
      <div >
        <ul className={
          pos?"nav-menu active":"nav-menu"
        }>
          {navitems.map((eachitem)=>{
            return(
              <>
                <li className={eachitem.cName}>
            <i  style={{margin:"7px"}}class={eachitem.icon}></i>
            <Link to={eachitem.url}>{eachitem.title}</Link>
            </li>
              </>
            )
          })}
          
          <button>Sign Up</button>
        </ul>
        
      </div>
      </div>
  </>
 
}
export default Navmenuitems;
